// src/App.js
import React, { useState } from "react";
import Navbar from "./components/Navbar"; // Make sure Navbar.jsx exists in components
import Home from "./pages/Home";          // Points to Home.jsx
import MatchEngine from "./pages/MatchEngine"; // Points to MatchEngine.jsx

function App() {
  const [currentPage, setCurrentPage] = useState("home"); // 'home' or 'find'

  return (
    <div className="bg-white min-h-screen">
      {/* Navbar with navigation callback */}
      <Navbar setCurrentPage={setCurrentPage} />

      {/* Render pages conditionally */}
      <main>
        {currentPage === "home" && <Home setCurrentPage={setCurrentPage} />}
        {currentPage === "find" && <MatchEngine />}
      </main>
    </div>
  );
}

export default App;
